{
  "$schema": "http://json-schema.org/draft-04/schema#",
  "type": "object",
  "title": "Cloud Pub/Sub Message",
  "description": "Message received by Cloud Pub/Sub.",
  "properties": {
    "data": {
      "type": "string",
      "description": "The message data sent by the publisher"
    },
    "attributes": {
      "type": "object",
      "description": "Attributes for this message"
    },
    "messageId": {
      "type": "string",
      "description": "ID of this message, assigned by the server when the message is published. Guaranteed to be unique within the topic."
    },
    "publishTime": {
      "type": "string",
      "description": "The time at which the message was published, populated by the server when it receives the topics.publish call"
    },
    "orderingKey": {
      "type": "string",
      "description": "Identifies related messages for which publish order should be respected."
    }
  }
}

